css:
@-moz-document url-prefix("http://www.tumblr.com/"), url-prefix("http://tumblr.com/") , url-prefix("https://www.tumblr.com/") {
body {
background: url("http://24.media.tumblr.com/tumblr_lvdrauWfPw1qa2akmo1_1280.jpg") #A5A5A5 no-repeat fixed center center;
}

#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {
background: rgba(0, 0, 0, 0.2);
}

#right_column {
background: none;
}

#right_column::after {
background: none;
}

img.content_top, img#content_top, img#content_bottom {
display: none;
}

#posts .post .permalink {
background: none;
}
}
